export function GetGridHeaders(roleNumber)
{
    var gridHeaders = [];

    switch(roleNumber)
    {
        case "01":
            gridHeaders.push({ title: "کد ملی مشتری", name: "customerNationalNumber" });
            gridHeaders.push({ title: "شماره مشتری", name: "customerNumber" });
            gridHeaders.push({ title: "حساب مبدا", name: "originAccount" });
            gridHeaders.push({ title: "جمع مبالغ تراکنش", name: "sumOfTransactionsAmount" });
            gridHeaders.push({ title: "تعداد تراکنش", name: "totalTransactionsCount" });
            gridHeaders.push({ title: "نام شعبه", name: "branchName" });
            gridHeaders.push({ title: "کد شعبه", name: "branchCode" });
            gridHeaders.push({ title: "نام شعبه عامل تراکنش", name: "relatedBranchName" });
            gridHeaders.push({ title: "کد شعبه عامل تراکنش", name: "relatedBranchCode" });
            gridHeaders.push({ title: "حقیقی / حقوقی", name: "isReal" });
            gridHeaders.push({ title: "تاریخ تراکنش", name: "transactionDate" });
        break;
        case "02":
            gridHeaders.push({ title: "کد ملی مشتری", name: "CustomerNationalNumber" });
            gridHeaders.push({ title: "شماره مشتری", name: "CustomerNumber" });
            gridHeaders.push({ title: "حساب مبدا", name: "OriginAccount" });
            gridHeaders.push({ title: "نام شعبه", name: "BranchName" });
            gridHeaders.push({ title: "کد شعبه", name: "BranchCode" });
            gridHeaders.push({ title: "حقیقی / حقوقی", name: "IsReal" });
            gridHeaders.push({ title: "تاریخ تراکنش", name: "TransactionDate" });
            gridHeaders.push({ title: "کد منطقه", name: "RegionCode" });
            gridHeaders.push({ title: "نام منطقه", name: "RegionName" });
            gridHeaders.push({ title: "جمع مبالغ تراکنش ساتنا و بین بانکی", name: "SumOfSatnaAmount" });
            gridHeaders.push({ title: "تعداد تراکنش ساتنا و بین بانکی", name: "TotalSatnaCount" });
        break;
    }

    return gridHeaders;
}
